// src/components/MoveButtons.js

import React from 'react';

const MoveButtons = ({ validMoves, onMoveClick }) => {
    return (
    <div className="move-buttons">
        {validMoves.map((move, index) => (
        <button key={index} onClick={() => onMoveClick(move)}>
            {move}
        </button>
        ))}
    </div>
    );
};

export default MoveButtons;
